function about() {
    return (
    
    <div style={{ width: 660, height: 'auto' }}>
      <Ratio aspectRatio="16x9">
        <embed type="image/svg+xml" src="/img/TheresaKnott_castle.svg" />
        <video src='./videos/CyberTEch Demo.mp4' autoPlay loop muted />
            
      </Ratio>
    </div>
  );
}
export default about
